CREATE TABLE IF NOT EXISTS "api_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group" varchar(50) NOT NULL);
CREATE TABLE IF NOT EXISTS "api_product_categories" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "product_id" integer NOT NULL REFERENCES "api_product" ("id") DEFERRABLE INITIALLY DEFERRED, "category_id" integer NOT NULL REFERENCES "api_category" ("id") DEFERRABLE INITIALLY DEFERRED);
