CREATE TABLE IF NOT EXISTS "api_purchased_styles" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "purchased_id" integer NOT NULL REFERENCES "api_purchased" ("id") DEFERRABLE INITIALLY DEFERRED, "style_id" integer NOT NULL REFERENCES "api_style" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "api_category" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "type" varchar(7) NOT NULL);
