CREATE TABLE IF NOT EXISTS "api_style" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "price" real NOT NULL, "description" varchar(200) NOT NULL, "num_requested" integer NOT NULL, "image_id" integer NULL REFERENCES "api_image" ("id") DEFERRABLE INITIALLY DEFERRED, "duration" real NOT NULL, "purchased_date" date NOT NULL, "type" varchar(10) NOT NULL, "date" date NOT NULL);
CREATE TABLE IF NOT EXISTS "api_stylist" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "type" varchar(10) NOT NULL, "image_id" integer NULL REFERENCES "api_image" ("id") DEFERRABLE INITIALLY DEFERRED, "name" varchar(25) NOT NULL, "email" varchar(25) NOT NULL, "phone" varchar(18) NOT NULL, "address" varchar(25) NOT NULL, "city" varchar(25) NOT NULL, "state" varchar(25) NOT NULL, "zipcode" integer NOT NULL, "date" date NOT NULL, "description" varchar(200) NOT NULL);
CREATE TABLE IF NOT EXISTS "api_product" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "price" real NOT NULL, "company" varchar(100) NOT NULL, "description" varchar(200) NOT NULL, "quantity" integer NOT NULL, "num_requested" integer NOT NULL, "image_id" integer NULL REFERENCES "api_image" ("id") DEFERRABLE INITIALLY DEFERRED, "type" varchar(10) NOT NULL, "purchased_date" date NOT NULL, "date" date NOT NULL);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "action_time" datetime NOT NULL, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL, "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "api_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "api_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "first_name" varchar(30) NOT NULL, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "phone" varchar(18) NOT NULL, "address" varchar(25) NOT NULL, "city" varchar(25) NOT NULL, "state" varchar(25) NOT NULL, "zipcode" integer NOT NULL, "stylist" bool NOT NULL, "cart_id" integer NULL UNIQUE REFERENCES "api_cart" ("id") DEFERRABLE INITIALLY DEFERRED, "image_id" integer NULL REFERENCES "api_image" ("id") DEFERRABLE INITIALLY DEFERRED, "purchased_id" integer NULL UNIQUE REFERENCES "api_purchased" ("id") DEFERRABLE INITIALLY DEFERRED, "groups" varchar(18) NOT NULL, "user_permissions" varchar(18) NOT NULL);
